function getAnswer(){

var thisData = "";
  var exampleData = "dabAcCaCBAcCcaDA";
  var finished = false;

  while(finished === false){
      var length = thisData.length;
      var newData = elminateCharacters(thisData);
      var newLength = newData.length;

      if(newLength < length){
        thisData = elminateCharacters(thisData);
        length = thisData.length;

      } else {
        finished = true;
        getCount(thisData);
      }
  }
}

function elminateCharacters(thisData){
  //console.log("entering as "+thisData + " and length = "+thisData.length);
  for (var i=0; i<thisData.length; i++) {
    if(thisData.charAt(i) !== thisData.charAt(i+1)){
    
      if(thisData.charAt(i).toLowerCase() === thisData.charAt(i+1).toLowerCase()){
        
        thisData = thisData.slice(0, i) + thisData.slice(i+2);
      }
    }
  }
  //console.log("exiting as "+thisData + " and length = "+thisData.length);
  return thisData;
}

function getCount(data){
  var count = data.length;
  document.getElementById('answerOne').innerText += count;
}